import React from 'react';
import PropTypes from 'prop-types';

import { Container } from './styles';

export default function EntregadoresTabela({ data }) {
  return (
    <Container>
      <small>#{data.id}</small>
      <small>{data.avatar ? <img src={data.avatar.url} alt="" /> : null}</small>
      <small>{data.name}</small>
      <small>{data.email}</small>
      <ButtonMore>
        <Button>
          <div>
            <button
              onClick={() => history.push(`/encomenda/${data.id}`)}
              type="button"
            >
              <MdEdit color="#4D85EE" size={10} />
              <span>Editar</span>
            </button>
          </div>
          <div>
            <button onClick={handleDelete} type="button">
              <MdDelete color="#DE3B3B" size={10} />
              <span>Excluir</span>
            </button>
          </div>
        </Button>
      </ButtonMore>
    </Container>
  );
}

EntregadoresTabela.propTypes = {
  data: PropTypes.shape({
    id: PropTypes.number,
    name: PropTypes.string,
    email: PropTypes.string,
    avatar: PropTypes.shape({
      url: PropTypes.string,
    }),
  }).isRequired,
};
